import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { CssBaseline, ThemeProvider, createTheme } from '@mui/material';
import { BrowserRouter } from 'react-router-dom';
import './styles/global.css';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#FBD437',
      light: '#ffe066',
      dark: '#c9a600',
      contrastText: '#023C4F'
    },
    secondary: {
      main: '#023C4F',
      light: '#03506f',
      dark: '#001d26',
      contrastText: '#FBD437'
    },
    background: {
      default: '#023C4F',
      paper: '#E0E0DF'
    },
    text: {
      primary: '#000',
      secondary: '#023C4F'
    },
    success: {
      main: '#00c853',
      dark: '#00a040'
    },
    error: {
      main: '#ff1744',
      dark: '#d50000'
    }
  },
  typography: {
    fontFamily: '"Inter", "Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontWeight: 800,
      letterSpacing: '-0.025em'
    },
    h2: {
      fontWeight: 800,
      letterSpacing: '-0.025em'
    },
    h3: {
      fontWeight: 700,
      letterSpacing: '-0.025em'
    },
    h4: {
      fontWeight: 700,
      letterSpacing: '-0.025em'
    },
    h5: {
      fontWeight: 600,
      letterSpacing: '-0.025em'
    },
    h6: {
      fontWeight: 600,
      letterSpacing: '-0.025em'
    },
    button: {
      fontWeight: 600,
      textTransform: 'none',
      letterSpacing: '-0.025em'
    }
  },
  shape: {
    borderRadius: 12
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 12,
          textTransform: 'none',
          fontWeight: 600,
          boxShadow: 'none',
          '&:hover': {
            boxShadow: 'none'
          }
        },
        contained: {
          backgroundColor: '#FBD437',
          color: '#023C4F',
          '&:hover': {
            backgroundColor: '#ffe066',
            color: '#023C4F'
          }
        }
      }
    },
    MuiCard: {
      styleOverrides: {
        root: {
          background: '#E0E0DF',
          borderRadius: 16,
          border: '1.5px solid #FBD437',
          boxShadow: '0 4px 24px 0 rgba(2,60,79,0.08)'
        }
      }
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            borderRadius: 12,
            background: '#fff',
            color: '#023C4F',
            '& fieldset': {
              borderColor: '#FBD437'
            },
            '&:hover fieldset': {
              borderColor: '#023C4F'
            },
            '&.Mui-focused fieldset': {
              borderColor: '#FBD437'
            }
          }
        }
      }
    }
  }
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <App />
      </ThemeProvider>
    </BrowserRouter>
  </React.StrictMode>
);
